Short description:
The Lat seat fits any 1" hole on a 3x3 tube, allowing it to go on an upright as a back support or a spotter arm for a variable height chest or seat pad. It is available in 9 upholstery options and comes with our <a href="https://straydogstrength.com/product/atr-lat-pull-low-row/" target="_blank" rel="noopener">Deluxe ATR Lat Pull Down Low Row Unit.</a>

The Lat Seats take between 1-3 weeks for production of the pad, other than Black which is in stock. <a href="https://straydogstrength.com/product/stray-dog-logo-hitch-pin/" target="_blank" rel="noopener">Comes With a Stray Dog Hitch Pin</a>

&nbsp;

&nbsp;

The Lock Jaw 2.0 Collar was designed to be the most durable quick release barbell clamp on the market, due to being light (.6 LBS) and large snap you can easily take the collars on and off with just one hand.

&nbsp;

&nbsp;

Our Stitched wear covers are available in 9 upholstery colors and can have custom CNC stitched logos with 100's of thread colors to match your logo. The wear covers easily attach with staples on the back of the bench pad and fit various pads from Fat pads to normal pads.<span style="color: #cc2606;"> <a style="color: #cc2606;" href="https://www.youtube.com/watch?v=IUckQ86dY54" target="_blank" rel="noopener">Click here for a video of how to attach the wear cover from Basement Brandon</a></span>

After you purchase a wear cover a solutions specialist will contact you via email to setup the logo approval process, we ask for Vector files, or high resolution JPG files of logos. If the logo is too complex there will be an additional $1oo fee but the customer will be notified and can submit a more basic logo or can request to cancel the order. All the examples listed online were not considered complex and did not require an upcharge accept the 1 armed Dog holding a Barbell that was a complex logo.

&nbsp;

The Stray Dog Power bar is an all purpose bar designed for a sports performance facility as it can be used for virtually any type of lift.  The Stray Dog Power Bar is proudly made in the USA with USA Steel.

&nbsp;

&nbsp;

Pre-Configured ATR #1 was designed to be a complete home gym, with a half rack, plate storage, bar storage, one or two cable columns and 1 or 0 Lat pull downs this unit has everything you need to lift at home.  Add any attachment to the unit or more storage for dumbbells, kettlebells or medicine balls.

<a href="https://straydogstrength.com/uncategorized/what-is-an-atr-unit-and-how-did-it-come-into-conception/" target="_blank" rel="noopener">Click here for an article further explaining ATR Units</a>

&nbsp;

The Alpha Single Utility Roller was designed to be a multi use roller that attaches with a single 1" threaded pin and <a href="https://straydogstrength.com/product/adjustable-nut/" target="_blank" rel="noopener">Adjustable Nut</a> compared to our <a href="https://straydogstrength.com/product/split-squat-knee-hold-attachment/" target="_blank" rel="noopener">Dual Utility Roller</a> which attaches with a <a href="https://straydogstrength.com/product/stray-dog-logo-hitch-pin/" target="_blank" rel="noopener">1" hitch pin</a>. Does not fit non 1" holes.

<a href="https://straydogstrength.com/uncategorized/which-roller-is-right-for-you/" target="_blank" rel="noopener">Click here for an article further explaining our different roller pad attachments</a>

&nbsp;

The Stray Dog Adjustable Speed Jump rope was designed to allow any size athlete to work on their footwork and or conditioning as the jump rope is adjustable starting at 120" with a simple screw adjustment. The Jump Rope is constructed out of an aluminum handle with a plastic coated steel cable that has bearings for smooth rotation.

&nbsp;

&nbsp;

The Neck Machine attachment was designed to give athletes the ability to train their neck at a rack station with either weight or band resistance.  It attaches with a 1" threaded rod and <a href="https://straydogstrength.com/product/adjustable-nut/" target="_blank" rel="noopener">Adjustable Nut</a> to any 3x3 1" hole rack.

